const initialState = {
    title: '',
    dropDownList: 'Road',
    price: ''
}

const reducer = (state = initialState, action) => {
    switch (action.type) {
        case 'UPDATE_FORM':
        return {
            ...state,
            ...action.newForm
        }
    
        default:
            return state
    }
}
